import React from 'react'
import axios from 'axios'

class NoteList extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            notes: []
        }
    }
    componentDidMount() {
        axios.get('http://localhost:3005/notes')
            .then(response => {
                this.setState(() => ({ posts: response.data }))
            })
    }
    render() {
        return (
            <div>
                <h1>notes</h1>
            </div>
        )
    }
}
export default NoteList
